      "excerpt": "<h2 id=\"什么是异常\"><a class=\"header-anchor\" href=\"#什么是异常\">#</a> 什么是异常</h2>\n<blockquote>\n<p>实际工作中，遇到的情况不可能是非常完美的。比如：你写的某个模块，用户输入的不一定符合你的额要求、你的程序要打开某个文件，这个文件可能不存在或者文件格式不对，你要读取的数据库的数据，可能是空的等等。程序跑着跑着内存或硬盘可能满了。</p>\n</blockquote>\n<blockquote>\n<p>软件程序在运行过程中，非常可能遇到刚出现的异常问题，我们统称为异常，英文是<code>Exception</code>，我们需要让我们写出的程序做出合理的处理，而不至于程序崩溃。</p>\n</blockquote>\n<p>异常的概念解析：</p>\n<ul>\n<li>异常指程序运行中出现的不期而至的各种状况</li>\n<li>异常发生在程序运行期间，它影响了正常的程序执行流程</li>\n</ul>\n<p>案例</p>\n<p><code>Exception in thread &quot;main&quot; java.lang.StackOverflowError</code></p>\n<!--beforebegin--><div class=\"language-java line-numbers-mode\"><!--afterbegin--><pre v-pre class=\"language-java\"><code><span class=\"token keyword\">public</span> <span class=\"token keyword\">class</span> <span class=\"token class-name\">Demo01</span> <span class=\"token punctuation\">{</span>\n    <span class=\"token keyword\">public</span> <span class=\"token keyword\">static</span> <span class=\"token keyword\">void</span> <span class=\"token function\">main</span><span class=\"token punctuation\">(</span><span class=\"token class-name\">String</span><span class=\"token punctuation\">[</span><span class=\"token punctuation\">]</span> args<span class=\"token punctuation\">)</span> <span class=\"token punctuation\">{</span>\n        <span class=\"token keyword\">new</span> <span class=\"token class-name\">Demo01</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">.</span><span class=\"token function\">a</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span> <span class=\"token comment\">// 无限循环，程序肯定会出错</span>\n    <span class=\"token punctuation\">}</span>\n\n    <span class=\"token keyword\">public</span> <span class=\"token keyword\">void</span> <span class=\"token function\">a</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span> <span class=\"token punctuation\">{</span>\n        <span class=\"token function\">b</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\n    <span class=\"token punctuation\">}</span>\n\n    <span class=\"token keyword\">private</span> <span class=\"token keyword\">void</span> <span class=\"token function\">b</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span> <span class=\"token punctuation\">{</span>\n        <span class=\"token function\">a</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\n    <span class=\"token punctuation\">}</span>\n<span class=\"token punctuation\">}</span>\n\n</code></pre>\n<div class=\"line-numbers-wrapper\"><span class=\"line-number\">1</span><br><span class=\"line-number\">2</span><br><span class=\"line-number\">3</span><br><span class=\"line-number\">4</span><br><span class=\"line-number\">5</span><br><span class=\"line-number\">6</span><br><span class=\"line-number\">7</span><br><span class=\"line-number\">8</span><br><span class=\"line-number\">9</span><br><span class=\"line-number\">10</span><br><span class=\"line-number\">11</span><br><span class=\"line-number\">12</span><br><span class=\"line-number\">13</span><br><span class=\"line-number\">14</span><br></div><!--beforeend--></div><!--afterend-->",
